     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "To favor our multi linear regreession model and the creation of our House calculator, I have decided to focus on a certain range of our dataset to push for more accurate results. we will be taking away all of the outliers, which represent luxurious and/or out of the common houses. \n",
    "To take away most of the outliers we will be using the domain knowledge and visual inspection of the upper range of our box plot previously executed."
   ]
  },
